    Reservas reserva = new Reservas();
    Factura factura = new Factura();
    String msj;
    Date INC;
    Date FIN;
    bool errorFecha = false;
    bool Confirmada = false;
    bool NoPermitirMasMes = false;
    bool NoPermitirMasAño = false;


